public FSTPath(T output, FST.Arc<T> arc, IntsRefBuilder input, float boost, CharSequence context, int payload) {
  this.arc = new FST.Arc<T>().copyFrom(arc);
  this.output = output;
  this.input = input;
  this.boost = boost;
  this.context = context;
  this.payload = payload;
}

